import React, { Component } from "react";
import NavComplete from "../components/navcomplete";

class AboutPage extends Component {
  state = {};
  render() {
    return (
      <div>
        <NavComplete />
        <div
          style={{
            maxWidth: 500,
            maxHeight: 500,
            height: "100%",
            width: "100%",
            backgroundColor: "rgb(255, 203, 105)",
            margin: 50,
            fontFamily: "Unna",
            fontSize: 70,
            fontWeight: "bold",
            display: "grid",
            alignContent: "center",
            gridTemplateRows: "80px 80px",
          }}
        >
          <div style={{ marginLeft: 30 }}>
            <div style={{ alignContent: "center" }}>Vivan</div>
            <div style={{ alignContent: "center" }}>Marwaha</div>
          </div>
        </div>
      </div>
    );
  }
}

export default AboutPage;
